  false,\n\t\"url\": null,\n\t\"notes\": \"Lake Mohave is one of several multi-purpose
  reservoirs that have been constructed on the Colorado River. The lake was formed
  upon completion of the Davis Dam in 1953. No mapping of the floor of the lake had
  been conducted since completion of the Davis Dam. The U.S. Geological Survey, in
  cooperation with researchers from the University of Nevada Las Vegas, completed
  a geophysical survey of this lake in April 2002. The survey included collection
  of sidescan sonar imagery of nearly the entire lake floor, and high-resolution seismic-reflection
  profiles along widely spaced lines throughout the lake. The detailed mapping of
  the lake floor was used to determine the amount of sediment that had accumulated
  in the lake since impoundment, its distribution, and the processes of deposition.
  For more information on the seismic surveys see http://woodshole.er.usgs.gov/operations/ia/public_ds_info.php?fa=2002-020-FA
  These data are also available via GeoMapApp (http://www.geomapapp.org/) and Virtual
  Ocean ( http://www.virtualocean.org/) earth science exploration and visualization
  applications.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
